export const Marker = () => {

    useEffect(()=>{

        const MarkerIcon = document.createElement('img')
        MarkerIcon.src = Fork_Icon
        console.log(MarkerIcon)

    },[])

    return <React.Fragment>

    
    <Pin></Pin>

    </React.Fragment>

}

export default Marker;
